package api.twilio.server.scaladsl.data

object DataCacher {
  private val report = ""

  /*
  {
      "data": {
          "result": "05050",
          "resultMessage": "The report awaits confirmation by the operator",
          "reportBase64": null,
          "token": "uuydjzkfiyjcynuvzwsghsrbkhhyguwp"
      },
      "errorMessage": null,
      "code": 200
  }
  * */
  case class ResultData(result: String, resultMessage: String, reportBase64: String, token: String)

  case class Result(data: ResultData, errorMessage: String, code: Int)

  private val results: Map[String, Result] = Map.empty

  def getResult(reqId: String) = results.getOrElse(reqId,
    Result(ResultData("05050", "The report awaits confirmation by the operator", null, "uuydjzkfiyjcynuvzwsghsrbkhhyguwp"), null, 200))

  def saveResult(reqId: String) = {
    results + reqId ->
      Result(ResultData("05000", "Successful", report, null), null, 200)
    results(reqId)
  }

  def getAllResult(reqId: String) = results


  /*
  {
      "data": {
          "result": "05000",
          "resultMessage": "Successful",
          "reportBase64": "",
          "token": null
      },
      "errorMessage": null,
      "code": 200
  }
  * */
}
